		{
			"_addr": "0xe062b30",
			"current_frame": "normal",
			"custom": 1,
			"face_right": 0,
			"label": "berd_man",
			"on_create": "
				if(level.player.get_stored_event('moth_boss_fight_won'),
					if(not level.player.get_stored_event('moth_boss_postfight_conversation'), [
						level.player.store_event('moth_boss_postfight_conversation',1),
						set(level.player.xy, [-750,-1650]),
						(obj dangling_rope_controller <- get_object_or_die(level, 'dangling_rope')).attach(level.player),
						set(level.player.animation, 'descend_rope'),
						schedule(300, [	set(level.player.animation, 'fall'),
										set(level.player.velocity_y, -400),
										(obj dangling_rope_controller <- get_object_or_die(level, 'dangling_rope')).detach(level.player),
										(obj frogatto_playable <- level.player).do_upon_landing( [def() fire_event(get_object_or_die(level,'berd_man'), 'landing_speech')] )
									])
						]
					)
				)
			",
			"on_landing_speech": "speech_dialog(
							set(level.player.facing, 1),
							set(Berd.animation, 'emote_talk'), 
					Berd,	[~There you are!  I'm so sorry!~, 
						~Don't worry about it.~, [speech_dialog(
										set(level.player.animation, 'emote_geez'),
							Frogatto,	[~Let's not dwell on it.\\nEverything turned out okay.~],
										set(level.player.animation, 'emote_nod'),
										[~Let's focus on the present.~],
				          				set(Berd.animation, 'emote_talk'), 
							Berd,		[~Yes, you do seem to be a little...~],
										set(Berd.animation, 'emote_gesticulate'),
										[~...geographically challenged at this point.~],
										set(level.player.animation, 'emote_geez'),
							Frogatto,	[~I don't think I burned enough calories in that\\nfight for you to fly me out of here.~],
										set(level.player.animation, 'emote_confused'),
										[~So... do I just live here now?~],
							Berd,		[~...~],
										set(Berd.animation, 'emote_wry'),
										[~Yes.~],
							Frogatto,	[~...~],
						)],
						~Thanks a lot!~,  [speech_dialog(
										set(level.player.animation, 'emote_raisedfinger'),
							Frogatto,	[~Sorry?  I should be thanking you!~],
										set(Berd.animation, 'emote_confused'),
							Berd,		[~What?  Why?~],
										set(level.player.animation, 'emote_confused'),
							Frogatto,	[~Well, you've given me\\nan idea for a new battle tactic.~],
										set(Berd.animation, 'emote_wry'),
							Berd,		[~Really?  Do tell.~],
										set(level.player.animation, 'emote_nod'),
							Frogatto,	[~It's simple.\\nFrom now on, whenever we encounter an enemy...~],
										set(level.player.animation, 'emote_raisedfinger'),
										[~I want you to convince them to let you pick\\nthem up and try to glide them down a canyon.~],
				          				set(Berd.animation, 'emote_talk'), 
							Berd,		[~...\\nLook, there's no need to-~],
										set(level.player.animation, 'emote_geez'),
							Frogatto,	[~I'm serious!  If Milgram is anywhere near as\\ngullible as I was, he won't be any trouble.~],
										set(Berd.animation, 'emote_confused'),
							Berd,		[~Hey now, that's...~],
										set(level.player.animation, 'emote_talk'),
							Frogatto,	[~What are the chances every pit will be neatly\\ngarrisoned with some horrible monster?~],
										set(level.player.animation, 'emote_oh'),
										[~I mean, we're now officially short by one, right?~],
										set(Berd.animation, 'emote_angry'),
							Berd,		[~Come off it already!  <em>Really!</em>~],
										set(level.player.animation, 'emote_nod'),
							Frogatto,	[~You're right, I'm sorry.~],
						)],
					]) where Berd = me, where Frogatto = level.player",
